import React, { Component } from 'react';
import faker from 'faker';
import Trainers from './Trainers';

class TrainerApp extends  Component{
    constructor(props){
        super();
    }

    render(){
        return(
            <div className="ui container trainers">
                <Trainers 
                    author="Sam"
                    timeAgo={setInterval(new Date().toLocaleTimeString(),1000)}
                    content="frontend stack"
                    avatar={faker.image.avatar()}
                />
                <Trainers 
                    author="Tom"
                    timeAgo={setInterval(new Date().toLocaleTimeString(),1000)}
                    content="backend stack"
                    avatar={faker.image.avatar()}
                />
                <Trainers 
                    author="Ivy"
                    timeAgo={setInterval(new Date().toLocaleTimeString(),1000)}
                    content="DataBase stack"
                    avatar={faker.image.avatar()}
                />

                <Trainers 
                    author="Leo"
                    timeAgo={setInterval(new Date().toLocaleTimeString(),1000)}
                    content="cloud stack"
                    avatar={faker.image.avatar()}
                />

            </div>

        );
    }



}
